import Head from 'nex/head';

const headerStyle = {
    backgroundColor: "blue",
    color: "white",
    width: "100%",
    height: "50px"
  };

  const Header = () => (
    <div className="Header" style={headerStyle}>
        <Head>
            <title>Next Project</title>
        </Head>
      HEADER
    </div>
  );

  export default Header;
